import React from "react";

const Task = ({ takList, deleteItem, id }) => {
  return (
    <>
      <li>
        {takList}
        <span
          onClick={() => {
            deleteItem(id);
          }}
        >
          <i class="fa-solid fa-xmark"></i>
        </span>
        <span
          onClick={() => {
            deleteItem(id);
          }}
        >
          <i class="fa-solid fa-xmark"></i>
        </span>
      </li>
    </>
  );
};

export default Task;
